function btn_flip() {
  var btns = document.querySelectorAll('.flip');
  btns.forEach(function (btn) {
    btn.onclick = function () {
      var card = btn.parentNode;
      card.classList.toggle('_active');
    };
  });
}

;

function team_btns() {
  var btns = document.querySelectorAll('.more');
  btns.forEach(function (btn) {
    btn.onclick = function () {
      btn.parentNode.classList.toggle('_active');
    };
  });
}

function team_add() {
  var team_list = document.querySelector('.team__list');
  var team_el = team_list.querySelectorAll('.team__el');
  team_el.forEach(function (el) {
    return el.remove();
  });
  data_team.forEach(function (el, idx) {
    add(el, idx);
  });

  function add(el, idx) {
    team_list.insertAdjacentHTML('beforeEnd', "<li class=\"team__el\" data-aos=\"zoom-in\" >\n        <img src=\"./assets/images/team/".concat(el.img, ".jpg\"/>\n        <div class=\"info\">\n          <div class=\"name\">").concat(el.name, "</div>\n          <div class=\"work\">").concat(el.work, "</div>\n          <div class=\"text scroll_1\">").concat(el.about, "</div>\n        </div>\n        <button class=\"more\"></button>\n      </li>"));
  }

  team_btns();
}

team_add();
